		function handlekeypress(event) {
			notPlaying = 0
			//רק אם הטיקר לא במצב עצור - כלומר אנחנו לא במצב השהייה בעקבות פגיעה
			if (createjs.Ticker.paused == false) {
				var dino = stage.getChildByName("dino")
				if (event.keyCode == 37) {
					//left
					if (dino.x > 70) {
						//מהירות הדמות
						dino.x -= dinoSideMovment; //כל עוד לא הגיע לגבול תתבצע תנועה שמאלה
					}
				}
				if (event.keyCode == 39) {
					//right
					if (dino.x < stageW - 10) {
						//מהירות הדמות
						dino.x += dinoSideMovment; //כל עוד לא הגיע לגבול תתבצע תנועה ימינה
					}
				}
				if (event.keyCode == 32) { //space
					return createStopGameScreen(",תחזרו מהר", "!אני מחכה לכם");
				}
				if (event.keyCode == 38) {
					// up to open the box with inner animation
		
				}
				if (event.keyCode == 40) {
					//down to close the box with inner animation
				}
			}
		}
		
